var ready;

ready = function() {
  var map;
  map = new Datamap({
    element: document.getElementById('container'),
    scope: 'usa',
    fills: {
      1: "#FF0000",
      2: "#FF3C3C",
      3: "#FF7777",
      4: "#FFBBBB",
      5: "#FFDFDF",
      6: "#DFEBFF",
      7: "#A9C9FF",
      8: "#74A8FF",
      9: "#3380FF",
      10: "#0060FF",
      defaultFill: 'green'
    },
    data: {
      FL: {
        fillKey: 1,
        numberOfThings: 10381
      },
      TX: {
        fillKey: 7,
        numberOfThings: 3000
      }
    },
    geographyConfig: {
      popupTemplate: function(geo, data) {
        return ['<div class="hoverinfo"><strong>', 'Number of things in ' + geo.properties.name, ': ' + data.numberOfThings, '</strong></div>'].join('');
      }
    }
  });
  map.legend();
};

$(document).ready(ready);

$(document).on('page:load', ready);

ready = function() {
  var socket;
  socket = io.connect('http://' + document.domain + ':' + location.port);
  socket.on('connect', function() {
    return socket.emit('my event', {
      data: "I'm connected!"
    });
  });
  return socket.on('message', function(msg) {
    return console.log('got it');
  });
};

$(document).ready(ready);

$(document).on('page:load', ready);

ready = function() {
  var socket;
  socket = io.connect('http://' + document.domain + ':' + location.port + NAMESPACE);
  socket.on('connect', function() {});
  return socket.on(MSG_NAME, function(msg) {
    return $('#log').append('<br>Received #' + msg.count + ': ' + msg.data);
  });
};

$(document).ready(ready);

$(document).on('page:load', ready);
